/*  BioDataCube_order                                         */
/*                                                            */
/**************************************************************/

static const OSEnumItem BioDataCube_order_ENUMTAB[] = {
   { OSUTF8("BDQ"), 0, 3, 0 },
   { OSUTF8("BQD"), 1, 3, 1 },
   { OSUTF8("DBQ"), 2, 3, 2 },
   { OSUTF8("DQB"), 3, 3, 3 },
   { OSUTF8("QBD"), 4, 3, 4 },
   { OSUTF8("QDB"), 5, 3, 5 }
} ;
#define BioDataCube_order_ENUMTABSIZE 6

const OSUTF8CHAR* BioDataCube_order_ToString (OSINT32 value)
{
   OSINT32 idx = value;

   if (idx >= 0 && idx < BioDataCube_order_ENUMTABSIZE) {
      return BioDataCube_order_ENUMTAB
         [BioDataCube_order_ENUMTAB[idx].transidx].name;
   }
   else
      return OSUTF8("_UNKNOWN_");
}

int BioDataCube_order_ToEnum (OSCTXT* pctxt,
   const OSUTF8CHAR* value, BioDataCube_order* pvalue)
{
   OSUINT32 valueLen = rtxUTF8LenBytes (value);
   OSINT32 idx = rtxLookupEnum (value, valueLen, BioDataCube_order_ENUMTAB, 
      BioDataCube_order_ENUMTABSIZE);

   if (idx >= 0) {
      *pvalue = (BioDataCube_order)BioDataCube_order_ENUMTAB[idx].value;
      return 0;
   }
   else {
      rtxErrAddStrParm (pctxt, (const char*)value);
      return LOG_RTERR (pctxt, RTERR_INVENUM);
   }
}

